INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "キャル", 7001, 106001, 0.0, 1, 0, 7, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2015/12/17 15:00:00", 1);
