INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 10001, 105801, 0.0, 1, 0, 10, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "キャル", 10002, 106001, 0.0, 1, 0, 10, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2015/12/17 15:00:00", 1);
