INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "キャル", 13001, 106001, 0.0, 1, 0, 13, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "コッコロ", 13002, 105901, 0.0, 1, 0, 13, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "シェフィ", 13003, 106401, 0.0, 1, 2104010, 13, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2015/12/17 15:00:00", 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 13004, 105801, 0.0, 1, 0, 13, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "コッコロ", 14001, 105901, 0.0, 1, 0, 14, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "シェフィ", 14002, 106401, 0.0, 1, 2104010, 14, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2015/12/17 15:00:00", 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 14003, 105801, 0.0, 1, 0, 14, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "キャル", 14004, 106001, 0.0, 1, 0, 14, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -470.0, "2030/12/17 14:59:59", "コッコロ", 15001, 105901, 0.0, 1, 0, 15, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "シェフィ", 16001, 106401, 0.0, 1, 2104010, 16, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2015/12/17 15:00:00", 2);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "ペコリーヌ", 16002, 105801, 0.0, 1, 0, 16, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "キャル", 16003, 106001, 0.0, 1, 0, 16, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "コッコロ", 16004, 105901, 0.0, 1, 0, 16, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2015/12/17 15:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 0, 1, -363.0, "2030/12/17 14:59:59", "コッコロ", 17002, 105901, 0.0, 1, 0, 17, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2015/12/17 15:00:00", 1);
