INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (8.0, 10011, 1, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24001, 109001, 4.08, 2, 0, 24, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (8.0, 10011, 2, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24002, 109001, 5.0, 2, 0, 24, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (8.0, 10011, 3, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24003, 109001, 10.11, 2, 0, 24, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (8.0, 10011, 4, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24004, 109001, 4.0, 2, 0, 24, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (8.0, 10011, 5, -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24005, 109001, 6.0, 2, 0, 24, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, 6, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24006, 109002, 0.0, 1, 0, 24, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, 7, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24007, 109002, 0.0, 1, 0, 24, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, 8, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24008, 109002, 0.0, 1, 0, 24, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, 9, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24009, 109002, 0.0, 1, 0, 24, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (0.0, 10011, 10, 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）", 24010, 109002, 0.0, 1, 0, 24, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2019/01/31 12:00:00", 1);
INSERT INTO `v1_85194edb20ea9bf7e641ebd44f5c97d3ac9f5cd454821eed4295b88d7ce977dd` VALUES (8.0, 10011, 1, -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）", 24011, 109101, 2.12, 2, 0, 24, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2019/01/31 12:00:00", 1);
